const buttonHit = option => () =>{
    if (option == "Happy"){
        alert(option);
    }
    if (option == "Angry"){
        alert(option);
    }
    if (option == "Sad"){
        alert(option);
    }
    if (option == "Depressed"){
        alert(option);
    }
    if (option == "Overwhelmed"){
        alert(option);
    }
    if (option == "Stressed"){
        alert(option);
    }
    if (option == "Scared"){
        alert(option);
    }
    if (option == "Disgusted"){
        alert(option);
    }
    if (option == "Nervous"){
        alert(option);
    }
    if (option == "In Love"){
        alert(option);
    }
    if (option == "Happy"){
        alert(option);
    }
};

export default buttonHit;
